SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

DROP DATABASE IF EXISTS `sport_station`;

CREATE DATABASE IF NOT EXISTS `sport_station`;

USE `sport_station`;

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `id` int(50) NOT NULL,
  `name` varchar(64) NOT NULL,
  `brand` varchar(64) NOT NULL,
  `category` varchar(64) NOT NULL,
  `stock` int(50) NOT NULL,
  `price` double NOT NULL,
  `image` text NOT NULL,
  `status` int(1) NOT NULL,
  `link_detail` text NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


ALTER TABLE `product`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `product`
  MODIFY `id` int(50) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=1547;
COMMIT;